function refreshTagList(){}$(document).ready(function(){$("#addContactForm").submit(function(n){n.preventDefault();var t={FirstName:$("#firstname").val(),LastName:$("#lastname").val(),Email:$("#email").val(),Subject:$("#subject").val()},i=$(this).data("action-url");$.ajax({url:i,type:"POST",data:t,success:function(){$("#successMessage").fadeIn().delay(2e3).fadeOut();$("#firstname").val("");$("#lastname").val("");$("#email").val("");$("#subject").val("");refreshTagList()},error:function(){alert("An error occurred while submitting the contact form.")}})});refreshTagList()});